			shellPath = /bin/sh;
			shellScript = "set -e\n\nFRAMEWORKS_DIR=\"${TARGET_BUILD_DIR}/${EXECUTABLE_FOLDER_PATH}/../Frameworks\"\nmkdir -p \"$FRAMEWORKS_DIR\"\n\n# Copy all FreeRDP dylibs into the app Frameworks folder\nif ls \"${SRCROOT}/vendor/FreeRDP/build-macos/install/lib/\"*.dylib >/dev/null 2>&1; then\n  cp -fL \"${SRCROOT}/vendor/FreeRDP/build-macos/install/lib/\"*.dylib \"$FRAMEWORKS_DIR/\"\nfi\n\nLIBS=\"libMacFreeRDP-library.dylib libfreerdp3.3.dylib libfreerdp-client3.3.dylib libwinpr3.3.dylib libssl.3.dylib libcrypto.3.dylib\"\n\n# Fix install names for bundled dylibs\nfor lib in $LIBS; do\n  if [ -f \"$FRAMEWORKS_DIR/$lib\" ]; then\n    install_name_tool -id \"@rpath/$lib\" \"$FRAMEWORKS_DIR/$lib\" || true\n  fi\ndone\n\n# Fix internal dylib cross-references to use @rpath\nfor lib in $LIBS; do\n  if [ -f \"$FRAMEWORKS_DIR/$lib\" ]; then\n    install_name_tool -change \"libMacFreeRDP-library.dylib\" \"@rpath/libMacFreeRDP-library.dylib\" \"$FRAMEWORKS_DIR/$lib\" 2>/dev/null || true\n    install_name_tool -change \"libfreerdp3.3.dylib\" \"@rpath/libfreerdp3.3.dylib\" \"$FRAMEWORKS_DIR/$lib\" 2>/dev/null || true\n    install_name_tool -change \"libfreerdp-client3.3.dylib\" \"@rpath/libfreerdp-client3.3.dylib\" \"$FRAMEWORKS_DIR/$lib\" 2>/dev/null || true\n    install_name_tool -change \"libwinpr3.3.dylib\" \"@rpath/libwinpr3.3.dylib\" \"$FRAMEWORKS_DIR/$lib\" 2>/dev/null || true\n    # Fix Homebrew OpenSSL paths to use bundled versions\n    install_name_tool -change \"/opt/homebrew/opt/openssl@3/lib/libssl.3.dylib\" \"@rpath/libssl.3.dylib\" \"$FRAMEWORKS_DIR/$lib\" 2>/dev/null || true\n    install_name_tool -change \"/opt/homebrew/opt/openssl@3/lib/libcrypto.3.dylib\" \"@rpath/libcrypto.3.dylib\" \"$FRAMEWORKS_DIR/$lib\" 2>/dev/null || true\n  fi\ndone\n\n# Rewrite app binaries to use @rpath for FreeRDP libs\nBIN_DIR=\"${TARGET_BUILD_DIR}/${EXECUTABLE_FOLDER_PATH}\"\nif [ -d \"$BIN_DIR\" ]; then\n  for bin in \"$BIN_DIR\"/*; do\n    if [ -f \"$bin\" ]; then\n      install_name_tool -change \"libMacFreeRDP-library.dylib\" \"@rpath/libMacFreeRDP-library.dylib\" \"$bin\" 2>/dev/null || true\n      install_name_tool -change \"libfreerdp3.3.dylib\" \"@rpath/libfreerdp3.3.dylib\" \"$bin\" 2>/dev/null || true\n      install_name_tool -change \"libfreerdp-client3.3.dylib\" \"@rpath/libfreerdp-client3.3.dylib\" \"$bin\" 2>/dev/null || true\n      install_name_tool -change \"libwinpr3.3.dylib\" \"@rpath/libwinpr3.3.dylib\" \"$bin\" 2>/dev/null || true\n    fi\n  done\nfi";
